import { useEffect, useState } from "react";
import "moment-timezone";
import Moment from "react-moment";

function App() {
  const [time, setTime] = useState(new Date());

  useEffect(() => {
    setInterval(() => setTime(new Date()), 1000);
  }, [time]);

  return;

  <h1>{time.toLocaleTimeString()}</h1>;
}

export default App;
